  the week of 1/9/2012, continuing to alternate from there. See http://bit.ly/wssHIB
  or https://data.cityofchicago.org/d/eb3b-ehmq for the full schedule. For more about
  Recycling in Chicago, visit http://bit.ly/IcfLHr. To view or use these files, compression
